export class BynarUniformPack extends BaseNeckProvider implements IUniformPack {

    getUniformSwatches() {
        return [
            new Swatch(BodyType.AverageMale, "Average", (token) => UniformCatalog.decorateSwatch(this.getNeck(BodyType.AverageMale, token.skinColor, undefined, UniformEra.Bynar) + BynarBody, BodyType.AverageMale, token), "BodyType.averageNonBinary"),
        ];
    }

    getRankSwatches() {
        return [
            new Swatch(Rank.None, "None", (token) => RankIndicatorCatalog.decorateSwatch("", Rank.None, token), "Rank.none.name"),
        ];
    }

    getRankIndicator(token: Token) {
        return "";
    }

    getRankBorderIndicator(token: Token) {
        return "";
    }

    getRankBorderDefinitions(token: Token, bordered: boolean) {
        return "";
    }

    getBorderColor(token: Token) {
        return "#cccccc";
    }

    getUniformVariantSwatches(token: Token) {
        return [];
    }

    getBorderLogo(token: Token): string {
        return "";
    }

    isDivisionColorSupported(token: Token): boolean {
        return false;
    }

    getUniformAndVariantBody(token: Token) {
        let result = BynarBody;
        let neck = this.getNeck(BodyType.AverageFemale, token.skinColor, token.species, UniformEra.Bynar);
        return neck.replace(SpeciesRestrictions.DEFAULT_SKIN_COLOR_REGEX, token.skinColor) + result;
    }
}